import "./App.css";
import DateTime from "./DateTime";

function App() {
  return (
    <div
      style={{
        width: "100%",
        height: "100%",
        position: "relative",
        background: "#FFF",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <div
        style={{
          width: 916,
          height: 578,
          left: 160,
          top: 90,
          position: "absolute",
          justifyContent: "center",
          alignItems: "center",
        }}
        Hello
      ></div>
      <img
        className="image-container"
        style={{
          width: "60%",
          height: "60%",
          borderRadius: 20,
          border: "1px black solid",
          justifyContent: "center",
          alignItems: "center",
        }}
        src="https://img.rawpixel.com/s3fs-private/rawpixel_images/website_content/rm428-0019-x.jpg?w=800&dpr=1&fit=default&crop=default&q=65&vib=3&con=3&usm=15&bg=F4F4F3&ixlib=js-2.2.1&s=16c4ed18afc4ccfb86f468a829d23a1d"
      />
    </div>
  );
}

export default App;
